import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/Navbar';
import './App.css';

const Home = () => <section id="home"><h1>Home</h1><p>Welcome to the home section.</p></section>;
const About = () => <section id="about"><h1>About</h1><p>Welcome to the about section.</p></section>;
const Education = () => <section id="education"><h1>Education</h1><p>Welcome to the education section.</p></section>;
const Projects = () => <section id="project"><h1>Projects</h1><p>Welcome to the projects section.</p></section>;
const Connect = () => <section id="connect"><h1>Connect</h1><p>Welcome to the connect section.</p></section>;

function App() {
  return (
    <Router>
      <div className="App">
        <Navbar />
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/about" element={<About />} />
          <Route path="/education" element={<Education />} />
          <Route path="/project" element={<Projects />} />
          <Route path="/connect" element={<Connect />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
